// components/Carousel.tsx
import React from 'react';
import Slider from 'react-slick'; // Adjust based on your chosen carousel library

interface CarouselProps {
  slides: string[];
}

const Carousel: React.FC<CarouselProps> = ({ slides }) => {
  const settings = {
    dots: false,
    arrows: false,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 5000, // Adjust autoplay speed as needed
    cssEase: 'linear',
  };

  return (
    <Slider {...settings}>
      {slides.map((slide, index) => (
        <div key={index}>
          <img src={slide} alt={`Slide ${index}`} className="w-full h-full object-cover" />
        </div>
      ))}
    </Slider>
  );
};

export default Carousel;
